import React from 'react';
import './App.css';

function App() {
  return (
    <div className="App">
      <header className="App-header">
        <h1>Welcome to Grocery Store</h1>
      </header>
      <main>
        <p>Your one-stop shop for all your grocery needs!</p>
      </main>
    </div>
  );
}

export default App;
